const ElementComponent = ({ element }) => {
    return (
        <div className="element"
            style={{
                "--group": element.group,
                "--period": element.period,
                color: element.state === "Gas" ? 'red' : element.state === "Liquid" ? 'blue' : undefined,
                backgroundColor: 
                element.type === "Metalloid" ? 'blue' : 
                element.type === "Non-metal"?'yellow':
                element.type === "Lanthanide"?'pink':
                element.type === "Actinide"?'yellow':
                undefined
            }}
        >
            <span className="atomic-number">{element.atomicNumber}</span>
            <span className="symbol">{element.symbol}</span>
            <span className="name">{element.name}</span>
        </div>
    );
};

export default ElementComponent;
